import React from 'react';

export default function ListaTrabajos() {
  return (
    <div className="container">
      <div className="card">
        <h1>Lista de trabajos</h1>
        <p>Esta es una vista mínima de lista de trabajos. Cuando el backend esté disponible, aquí mostraremos los trabajos.</p>
      </div>
    </div>
  );
}
